    height: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
   background: rgb(50,142,65);
  // background: linear-gradient(90deg, rgba(50,142,65,1) 4%, rgba(70,106,166,0.938813025210084) 100%, rgba(0,212,255,1) 100%);
`;

const WhyusContainer = styled.div`
  
 
    width: 80%;
    height: 100%;
    background: #999;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    margin-bottom: 5%;
 
`;




const Home = () => {
  return (
    <div>
      <AppContainer >
        <h1 style={{ display: 'flex', justifyContent: 'center', alignItems: 'top', height: '100%' }}>home</h1>




        <WhyusContainer >
          <h1>why us</h1>
        </WhyusContainer>

      </AppContainer>
    </div>
  );
};

export default Home;
